/* globals EvalDecode, ArrayDecode, _NumberDecode, JSFuckDecode, ObfuscatorIO, CleanSource, AADecode, JJdecode, Urlencoded, P_A_C_K_E_R, JavascriptObfuscator, MyObfuscate */
/* eslint-disable no-console */

self.addEventListener('message', (e) => {
  self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/math.min.js');
  self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/utils.min.js');

  let source = e.data.source;
  const packer = e.data.packer;
  const options = e.data.options;

  const methods = {
    evalencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/evaldecode.min.js');
      return EvalDecode(source);
    },
    _numberencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/numberdecode.min.js');
      return _NumberDecode(source);
    },
    arrayencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/arraydecode.min.js');
      return ArrayDecode(source, options);
    },
    jsfuck: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/jsfuckdecode.min.js');
      return JSFuckDecode(source);
    },
    obfuscatorio: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/obfuscatorio.min.js');
      return ObfuscatorIO(source, options);
    },
    cleansource: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/cleansource.min.js');
      return CleanSource(source, options);
    },
    aaencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/aadecode.min.js');
      return AADecode.decode(source);
    },
    jjencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/jjdecode.min.js');
      return JJdecode.decode(source);
    },
    urlencode: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/urlencode_unpacker.min.js');
      if (Urlencoded.detect(source)) return Urlencoded.unpack(source);
      throw 'Not matched';
    },
    p_a_c_k_e_r: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/p_a_c_k_e_r_unpacker.min.js');
      if (P_A_C_K_E_R.detect(source)) return P_A_C_K_E_R.unpack(source);
      throw 'Not matched';
    },
    javascriptobfuscator: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/javascriptobfuscator_unpacker.min.js');
      if (JavascriptObfuscator.detect(source)) return JavascriptObfuscator.unpack(source);
      throw 'Not matched';
    },
    myobfuscate: () => {
      self.importScripts('https://cdn.statically.io/gh/rooplal/js-unpack/main/js/other/myobfuscate_unpacker.min.js');
      if (MyObfuscate.detect(source)) return MyObfuscate.unpack(source);
      throw 'Not matched';
    },
  };

  try {
    source = methods[packer]();
  } catch (err) {
    throw new Error(err);
  }

  self.postMessage(source);
});
